// components/ui/button.js
import { motion } from "framer-motion";

export function Button({ children, className, ...props }) {
  return (
    <motion.button
      whileHover={{ scale: 1.05 }}
      whileTap={{ scale: 0.95 }}
      className={`px-4 py-2 font-medium rounded-2xl transition-all ${className}`}
      {...props}
    >
      {children}
    </motion.button>
  );
}
